import ReactDOM from 'react-dom';
import React from 'react';
import './index.css';
import App from './App.jsx';
import { CartMaker } from './context/CartContext.jsx';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <CartMaker>
    <App />
  </CartMaker>
);

